import React from "react";
import InsertList from "../component/list"
function Dashboard(props) {
  return (
    <div>
      <Grid container spacing={2}>
        <Grid item xs={0} sm={0} md={4} lg={4} xl={4} >
          <InsertList/>
        </Grid>
        <Grid item xs={4}>
          <Item>xs=4</Item>
        </Grid>
      </Grid>
    </div>
  );
}

export default Dashboard;
